import React from 'react';
import {useRouteMatch} from 'react-router';
import {
    Route,
    Switch
} from 'react-router-dom';

import {
    AccountMain,
    Login,
    Register
} from './AccountSub';

const Account = () => {
    const {path} = useRouteMatch();

    return (
        <div className="account">
            <Switch>
                <Route path={`${path}/login`}>
                    <Login />
                </Route>
                <Route path={`${path}/register`}>
                    <Register />
                </Route>
                <Route path='/'>
                    <AccountMain />
                </Route>
            </Switch>
        </div>
    )
}

export default Account;
